import MainPage from "./MainPage";
import {
  Routes,
  Route,
} from "react-router-dom";
import SignIn from "./SIgnIn/SignIn";
function App() {
  return (
    <Routes>
      <Route path="/" element={<SignIn />}>
        <Route index element={<SignIn />} />
        <Route path="teams" element={<MainPage />}/>
      </Route>
    </Routes>
  );
}

export default App;
